import React from 'react';
import './App.css';
import logo from './navlogo.png';
import {Navbar, Nav, NavDropdown} from 'react-bootstrap';
import PuppyPage from './pages/PuppyPage';
import AboutPage from './pages/AboutPage';
import GalleryPage from './pages/GalleryPage';
import HomePage from './pages/HomePage';
import DepositPage from './pages/DepositPage';
import RegisterPage from './pages/RegisterPage';
import {BrowserRouter, Route, Link } from 'react-router-dom';
import data from './data';
import ContactPage from './pages/ContactPage';
import SigninPage from './pages/SigninPage';
import AboutCairnCare from './pages/CairnCare';
import AboutDiet from './pages/AboutDiet';
import AboutHomeRaised from './pages/AboutHomeRaised';
function App() {
  return (
    <div>
    <BrowserRouter>
    <Navbar fixed="top" />
    <Navbar collapseOnSelect expand="lg" bg="light" variant="light">
  <Navbar.Brand> 
  <Link to="/"> <img src={logo} /></Link>
  </Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link><Link to="/AboutPage"> About </Link></Nav.Link>
      <Nav.Link><Link to="/ContactPage"> Contact </Link></Nav.Link>
      <Nav.Link><Link to="/GalleryPage"> Gallery </Link></Nav.Link>
      <NavDropdown.Divider />
      <Nav.Link><Link to="/DepositPage"> Deposit </Link></Nav.Link>
      {/*
      <Nav.Link><Link to="/SigninPage"> Signin </Link></Nav.Link>
      */}
    </Nav>
  </Navbar.Collapse>
</Navbar>
    <div className="grid-container">

<main className="main">
    <div className="content">
    <Route path="/puppy/:id" component={PuppyPage} />
    <Route path="/" exact={true} component={HomePage} />
    <Route path="/DepositPage" component={DepositPage} />
    <Route path="/AboutDiet" component={AboutDiet} />
    <Route path="/AboutHomeRaised" component={AboutHomeRaised} />
    <Route path="/AboutPage" component={AboutPage} />
    <Route path="/AboutCairnCare" component={AboutCairnCare} />
    <Route path="/ContactPage" component={ContactPage} />
    <Route path="/GalleryPage" component={GalleryPage} />
    {/*
    <Route path="/SigninPage" component={SigninPage} />
  <Route path="/RegisterPage" component={RegisterPage} />
    */}
</div>

</main>

</div>
</BrowserRouter>
<HomePage/>
</div>
  );
}

export default App;
